import React, { useEffect, useState } from "react";
import Navbar from "../components/Navbar"; // Navbar global
import Header from "../components/MainHeader"; // Header global
import "./Dashboard.css";

const Dashboard = () => {
    const [user, setUser] = useState(null);

    useEffect(() => {
        const storedUser = JSON.parse(localStorage.getItem("user"));
        if (storedUser) {
            setUser(storedUser);
        }
    }, []);

    if (!user) {
        return <p>Cargando...</p>; // Mostrar mientras carga el usuario
    }

    return (
        <section className="dashboard-content">
            {/* Survey Section */}
            <div className="survey-card">
                <h2>Mi encuesta:</h2>
                <div className="survey-details">
                    <h3>Total de respuestas:</h3>
                    <span className="responses">150</span>
                    <p>IPUC el diamante</p>
                    <span className="date">30/12/2024</span>
                    <span className="committee">
                        Comité: <span className="committee-badge">Jóvenes</span>
                    </span>
                    <h3>Área Espiritual</h3>
                    <p>Daniel Moreno</p>
                    <div className="survey-buttons">
                        <button className="btn">Ver todas</button>
                        <button className="btn">Enviar todas</button>
                    </div>
                </div>
            </div>

            {/* Leaders Section */}
            <div className="leaders-section">
                <h2>Líderes</h2>
                <div className="leaders-header">
                    <span>Sort by: <a href="#">Recently</a></span>
                    <div className="actions">
                        <button className="btn">Imprimir</button>
                        <button className="btn">Compartir</button>
                    </div>
                </div>
                <table className="leaders-table">
                    <thead>
                        <tr>
                            <th>Nombre</th>
                            <th>Cargo</th>
                            <th>Comité</th>
                            <th>Edad</th>
                        </tr>
                    </thead>
                    <tbody>
                        {Array(5).fill().map((_, index) => (
                            <tr key={index}>
                                <td>Samuel Moreno Mancera</td>
                                <td>Presidente</td>
                                <td>Alabanza</td>
                                <td>18</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
                <a href="#" className="view-more">Ver todos los líderes</a>
            </div>
        </section>

    );
};

export default Dashboard;
